import React from 'react'
import './body.css';
import {Post} from '../../components/index';
import announcement from '../../assets/icons/announcement.svg';
import icon from '../../assets/icons/profile-mini-icon.svg';
import upvote from '../../assets/icons/upvote.svg';
import downvote from '../../assets/icons/downvote.svg';
const Body = () => {
  return (
    <div className='body__container section__padding'>
      
    <div className='body__container-main-post'>
      <div className='post-header'>
        <img src={icon}></img>
      <div className='username'>AtorniPulpul  </div>
      <div className='course-page'>Posted in <span className='course-name-main'>c/CCPROG3</span> </div>
      <div class="post-up-down-buttons">
                                <div class="post-vote">
                                    <button class="post-vote-button"><img className="post-vote-button-img" src={upvote}></img></button>
                                    <span class="post-vote-count">30</span>
                                </div>

                                <div class="post-vote">
                                    <button class="post-vote-button"><img className="post-vote-button-img" src={downvote}></img></button>
                                    <span class="post-vote-count">10</span>
                                </div>
                            </div>
      </div>

    </div>
    </div>
  )
}

export default Body
